Let's define the cost of one pliatsit as \( p \) dollars and the cost of one suur kustutust as \( s \) dollars. According to the problem, we have the following system of equations:

1. Two pliatsits and one suur kustutust cost $1.24:
\[ 2p + s = 1.24 \]

2. Five pliatsits and one suur kustutust� cost $1.82:
\[ 5p + s = 1.82 \]

We need to find the cost of one pliatsit, \( p \). To eliminate \( s \), we can subtract the first equation from the second equation:

\[ (5p + s) - (2p + s) = 1.82 - 1.24 \]
\[ 5p + s - 2p - s = 0.58 \]
\[ 3p = 0.58 \]

Now, we solve for \( p \) by dividing both sides of the equation by 3:

\[ p = \frac{0.58}{3} \]
\[ p = 0.1933333333 \]
